me: 190.19 ms &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://10.32.2.33:35865 &lt;/li&gt;\n          &lt;li&gt; Workers: 64 &lt;/li&gt;\n          &lt;li&gt; Threads: 64 &lt;/li&gt;\n          &lt;li&gt; Memory: 0.93 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.09.1 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2021.09.1 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\n\nfrom dask_jobqueue import SLURMCluster\nfrom distributed import Client\n\nfrom dask.distributed import performance_report, get_task_stream\n\nimport logging\nlogging.basicConfig(format='%(levelname)s:%(message)s', level=logging.DEBUG)\n\ncores = 32\nnodes = 2\n\ncluster = SLURMCluster(memory          = '{}g'.format(16*cores),\n                       processes       = cores,\n                       name            = 'testdask-${JOB_ID}',\n                       cores           = cores,\n                       queue           = 'photon',\n                       local_directory = '/tmp',\n                       death_timeout   = '100000000000s',\n                       walltime        = '01:00:00',\n                       header_skip     = ['-n 1'], \n                       env_extra       = ['JOB_ID=${SLURM_ARRAY_JOB_ID}_${SLURM_ARRAY_TASK_ID}'],\n                       job_extra       = ['--ntasks-per-node=1', '--array=0-{}'.format(nodes-1), '--exclusive']) \n\ncluster.scale(jobs=1)\nclient = Client(cluster)\n\nclient.get_versions(check=True)\n\n\n#import pdb; pdb.set_trace()\nimport time\nimport datetime\n\nnow = datetime.datetime.now()\nclient.upload_file('../../root/root_rdfenv-ucx-2/lib/DistRDF/Backends/Dask/Backend.py')\nclient.upload_file('../../root/root_rdfenv-ucx-2/lib/ROOT/__init__.py')\n\nimport ROOT\nROOT.gROOT.SetBatch(True)\nRDataFrame = ROOT.RDF.Experimental.Distributed.Dask.RDataFrame\n\nlater = datetime.datetime.now()\ndiff = (later - now)\nprint(diff)\n\n\n\ndef dimuonSpectrum(df):\n\n    # Select events with exactly two muons\n    df_2mu = df.Filter(\"nMuon == 2\", \"Events with exactly two muons\")\n\n    # Select events with two muons of opposite charge\n    df_os = df_2mu.Filter(\"Muon_charge[0] != Muon_charge[1]\", \"Muons with opposite charge\")\n\n    # Compute invariant mass of the dimuon system\n    df_mass = df_os.Define(\"Dimuon_mass\", \"ROOT::VecOps::InvariantMass(Muon_pt, Muon_eta, Muon_phi, Muon_mass)\")\n\n    # Book histogram of dimuon mass spectrum\n    bins = 30000  # Number of bins in the histogram\n    low = 0.25  # Lower edge of the histogram\n    up = 300.0  # Upper edge of the histogram\n    hist = df_mass.Histo1D(ROOT.RDF.TH1DModel(\"\", \"\", bins, low, up), \"Dimuon_mass\")\n\n    #hist.GetValue() # triggers the event loop\n    watch = ROOT.TStopwatch() \n    hist.GetValue() # triggers the event loop \n    elapsed = watch.RealTime() \n    print(\"Event Loop =\", elapsed) \n    file_out = open('../../distrdf_timestamps.out', 'a') \n    file_out.write(\"\\nEvent Loop={}s\\n\".format(elapsed)) \n    file_out.close()\n\n\nif __name__ == '__main__':\n    \n    filelist = [\"input_files/dimuon/f{}.root\".format(i) for i in range(1, 101)]\n    df = RDataFrame(\"Events\", filelist, npartitions=256, daskclient=client) \n   \n    #import pdb; pdb.set_trace()\n   \n    for r in range(3):\n        client.wait_for_workers(cores*nodes)\n        with performance_report(filename=\"dask-report_{}.html\".format(r)):\n            dimuonSpectrum(df)\n    client.close()\n\n        &lt;/pre&gt;\n        "},"id":"5823","type":"Div"},{"attributes":{},"id":"5880","type":"Selection"},{"attributes":{"child":{"id":"5823"},"title":"Summary"},"id":"5824","type":"Panel"},{"attributes":{"tools":[{"id":"5808"},{"id":"5809"},{"id":"5810"}]},"id":"5811","type":"Toolbar"},{"attributes":{},"id":"5917","type":"DatetimeTickFormatter"},{"attributes":{"format":"0.0 b"},"id":"5629","
